import { Navbar, Nav, FormControl } from 'react-bootstrap';

export default function Header () {
    return (
        <Navbar>
            <Navbar.Brand href="/">Logo</Navbar.Brand>       

            <Nav.Link href="#signin">Sign in</Nav.Link>          
        </Navbar>
    )
}
